import React from "react";

const Footer = () => {
  return (
    <div className="bg-gray-700 p-4">
      <div className="container mx-auto text-center font-bold text-white">
        Projeto Desenvolvido por: Elian Marcos /
        <a className='px-2 hover:underline' href="https://linkedin.com/in/elian-marcos/"> Linkedin</a> /
        <a className='px-2 hover:underline' href="https://github.com/Elian07"> GitHub</a> /
      </div>
    </div>
  );
};

export default Footer;
